var promiseWhile = function(condition, action) {
    var resolver = bluebird.defer();
 
    var loop = function() {
        if (!condition()) return resolver.resolve();
        return bluebird.cast(action())
            .then(loop)
            .catch(resolver.reject);
    };
 
    process.nextTick(loop);
 
    return resolver.promise;
};

